import React, { useState } from 'react';
import './App.css';
import Dashboard from './components/Dashboard';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <div className="background-pattern"></div>
      <Header />
      <Dashboard />
    </div>
  );
}

export default App;
